import FormInput from './components/FormInput';
import List from './components/List';

function App() {
  return (
    <div className="App">
      <h1>To Do List </h1>
      <FormInput />

      <div className='row'>
        <label htmlFor='all'>
          <input type='checkbox' name='all' id='all'></input>
          ALL
        </label>
        <p>You have 0 to do</p>
        <button id="delete">Delete</button>
      </div>
    </div>
  );
}
export default App;
